import InfoToolTip from "./InfoToolTip";
import DoneImage from "../../images/Union_ok.svg"

function DoneInfoToolTip ({ isOpen }) {
  return (
    <InfoToolTip
    img={DoneImage}
    title="Вы успешно зарегистрировались!"
    isOpen={isOpen}
    />
  )
}

export default DoneInfoToolTip;
